import { Routes, Route } from "react-router-dom";
import Cards from "../components/Cards";
import Exercises from "../components/Exercises";
import Listening from "../components/Listening";
// import LoginAuth from "../components/LoginAuth";
import LoginPage from "../components/LoginPage";
import Menu from "../components/Menu";
import Session from "../components/Session";
import Shorts from "../components/Shorts";
import AuthContext, { AuthProvider } from "../context/AuthContext";
import { useNavigate } from "react-router-dom";
import { useContext } from "react";
const Routers = () => {
  const navigate = useNavigate();
  let { user } = useContext(AuthContext);
  return (
    <Routes>
      <Route path="/signup" element={<LoginPage />}></Route>

      <Route path="/login" element={<Session />}></Route>
      {/* <Route path="/login" element={<LoginAuth />}></Route> */}
      <Route
        path="/menu"
        element={user ? <Menu /> : navigate("/login")}
      ></Route>
      <Route path="/menu/cards" element={<Cards />}></Route>
      <Route path="/menu/exercises" element={<Exercises />}></Route>
      <Route path="/menu/listening" element={<Listening />}></Route>
      <Route path="/menu/shorts" element={<Shorts />}></Route>
    </Routes>
  );
};

export default Routers;
